import * as React from 'react';
import { View, Text,Touchable } from 'react-native';
import ActionLine from '../../components/ActionLine';
import InforLine from '../../components/InforLine';
import Icon from 'react-native-vector-icons/Feather';
export default function SettingsScreen({ navigation }) {
    return (
        <>
        <Touchable onPress={() => navigation.navigate('Ngôn ngữ')}> 
        <View> 
            <InforLine title="Ngôn ngữ" value={'Tiếng Việt'} stack={true}/>
        </View>
        </Touchable>
        
        <Touchable onPress={() => navigation.navigate('Profile')}> 
        <View> 
            <ActionLine title="Chế độ" value={1200000}  />
        </View>
        </Touchable>
        </>
    );
}
